one of each item and the rest will be given away.<\/p><p>Try to get as many items as you can. <\/p><p>Here are the icons representing the objects:<\/p><p>Medicine: <img src="http://emotions.usc.edu/group/images/Pills-MD.png" alt="Medicine" width="42" height="42" /><\/p><p>Water Bottles: <img src="http://emotions.usc.edu/group/images/Waterbottle-MD.png" alt="Water Bottles" width="42" height="42" /><\/p><p>Money: <img src="http://emotions.usc.edu/group/images/CashPic-MD.png" alt="Money" width="42" height="42" /><\/p><p>Food Cans: <img src="http://emotions.usc.edu/group/images/can-new.png" alt="Food Cans" width="42" height="42" /><\/p>',sld='<pre>',c4c='<span',A8c="<span style='color:",eAd='<style type="text/css">Label-style {font-family: Arial, sans-serif;font-size: 27px;}<\/style><Label-style>This is the last round of the negotiation.<br><br>After seeing the other player\u2019s proposal,<br>you can either decide to accept the other player\u2019s proposal<br>or if you don\u2019t agree with the proposal, <br>you can decide to toss a coin.<br><br>If it comes up \u201Cheads\u201D, you will get two of each item,<br>if it comes up \u201Ctails\u201D, you will get none of the items.<\/Label-style>',Jad='=',qld='==========\n',jld='============\n',lld='========================================================\n',KAd='=P',f4c='>',qZc='?',POc='@',D2c='A request timeout has expired after ',w4c='A-Za-z\xC0-\xD6\xD8-\xF6\xF8-\u02B8\u0300-\u0590\u0800-\u1FFF\u2C00-\uFB1C\uFDFE-\uFE6F\uFEFD-\uFFFF',d0c='ABSOLUTE',N8c='ALL',NYc='ALPHABETIC',uFd='ANNOTATION_TYPE',v_c='AUTO',$Rd='AbsolutePanel',pWc='AbsolutePanel.java:',CKd='AbsolutePositionDropController',DKd='AbsolutePositionDropController$Draggable',nXc='AbsolutePositionDropController.java:',iLd='AbstractActivity',KKd='AbstractArea',XRc='AbstractArea.java:',TKd='AbstractCollection',CPc='AbstractCollection.java:',QKd='AbstractDragController',TOc='AbstractDragController.java:',AKd='AbstractDropController',jXc='AbstractDropController.jav
